import React from 'react';
import './style.css'

function Bio() {
    return (
        <div>
            <div className="header"></div>
            <aside className="leftSide">
                <div>
                    <div className="profile">
                        <img src="https://images.unsplash.com/photo-1505740420928-5e560c06d30e?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80" alt="" className="photo" />
                    </div>
                    <h1 className="nameUser">Giovani Ronaldo</h1>
                </div>
            </aside>
        </div>
    )
}


export default Bio;
